import { Link } from 'react-router-dom';

const ProductsPage = () => {
    return (
        <>
            <h1>My Products</h1>
            <ul>
                <li>My Product 1</li>
                <li>My Product 2</li>
                <li>My Product 3</li>
                <li>My Product 4</li>
   
            </ul>
        </>
    );



}
export default ProductsPage;
